package br.com.sulamerica.ats.api.utils;

import java.io.FileNotFoundException;
import java.io.FileOutputStream;
import java.io.IOException;

import org.apache.commons.codec.binary.Base64;
import org.springframework.stereotype.Component;

@Component
public class PdfGeneratorImpl implements PdfGenerator {

	@Override
	public void geraPdf(String arquivo64) {

		String base = "";
		byte[] arr = base.getBytes();

		byte[] decodedBytes = Base64.decodeBase64(arr);

		try {
			FileOutputStream fop = new FileOutputStream("c:/Users/fdl0415/newfile.pdf");
			fop.write(decodedBytes);
			fop.flush();
			fop.close();
		} catch (IOException e) {

		}
	}

}
